import React from 'react';

const CustomSelect = ({options, defVal}) => {
	return (
		<select>
			<option disabled value="">{defVal}</option>
			{
				options.map(option=>
					<option key={op} value={option.value}>{option.name}</option>
				)
			}
		</select>
	);
}

export default CustomSelect;
